class Solution {
    func beautifulSubstrings(_ s: String, _ k: Int) -> Int {
        var result = 0
        let chars = Array(s)
        let n = chars.count
        var freq = Array(repeating: 0, count: 2 * n + 1)
        var balance = 0
        freq[n] = 1

        for char in chars {
            if "aeiou".contains(char) {
                balance += 1
            } else {
                balance -= 1
            }

            for div in stride(from: 1, through: min(k, n), by: 1) where k % div == 0 {
                if balance - div + n >= 0 {
                    result += freq[balance - div + n]
                }
                if balance + div + n < 2 * n + 1 {
                    result += freq[balance + div + n]
                }
            }
            freq[balance + n] += 1
        }

        return result
    }
}
